import React from "react";

function AddProductForm (){


    return (
        <form>
            <label>
                SKU:
                <input type="text" name="sku" />
            </label>

            <label>
                Name:
                <input type="text" name="name" />
            </label>

            <label>
                Price($):
                <input type="text" name="price" />
            </label>

        </form>
    )

}

export default AddProductForm;
